import React from 'react';
import { NavLink } from 'react-router-dom';

export default function Overlay(props) {



  return (
		<div className={`overlay-menu ${props.isOpen ? "" : "active-menu"}`}>
			<ul>
				<li>
					{" "}
					<NavLink const style = {NavLinkStyle} to="/" onClick={props.toggle}>
						Home
					</NavLink>{" "}
				</li>
				<li>
					{" "}
					<NavLink to="/about" onClick={props.toggle}>
						About
					</NavLink>{" "}
				</li>
				<li>
					{" "}
					<NavLink to="/products" onClick={props.toggle}>
						Products
					</NavLink>{" "}
				</li>
				<li>
					{" "}
					<NavLink to="/recipes" onClick={props.toggle}>
						Recipes
					</NavLink>{" "}
				</li>
				<li>
					{" "}
					<NavLink to="/kids" onClick={props.toggle}>
						Kid's Corner
					</NavLink>{" "}
				</li>
				<li>
					{" "}
					<NavLink to="/contact" onClick={props.toggle}>
						Contact Us
					</NavLink>{" "}
				</li>
			</ul>
		</div>
  );
}
